<!doctype html>
<html>
<head>
    <title>issue23</title>
    <style>
        body, html, code, pre {
            padding: 0;
            margin: 0
        }

        html {
            background-color: #1d1f21
        }

        code {
            margin: 0;
            font-family: Menlo, monospace;
            font-size: 11px
        }
    </style>
    <link rel="stylesheet" href="css/hybrid.css">
</head>
<body>
<pre><code></code></pre>
<script src="js/highlight.pack.js" type="text/javascript"></script>
<script src="_compiled/demo/goog/base.js" type="text/javascript"></script>
<script src="_compiled/demo/devtools_sample.js" type="text/javascript"></script>
<script>

    goog.object.extend = function(target, var_args) {
        var key, source;
        for (var i = 1; i < arguments.length; i++) {
            source = arguments[i];
            for (key in source) {
                console.warn("!", key);
                target[key] = source[key];
            }

            // For IE the for-in-loop does not contain any properties that are not
            // enumerable on the prototype object (for example isPrototypeOf from
            // Object.prototype) and it will also not include 'replace' on objects that
            // extend String and change 'replace' (not that it is common for anyone to
            // extend anything except Object).

            for (var j = 0; j < goog.object.PROTOTYPE_FIELDS_.length; j++) {
                key = goog.object.PROTOTYPE_FIELDS_[j];
                if (Object.prototype.hasOwnProperty.call(source, key)) {
                    target[key] = source[key];
                }
            }
        }
    };

    goog.require('devtools_sample.issue23');
</script>
</body>
</html>
